import React, { Component } from 'react'

export default class CreateBug extends Component {
    constructor(props) {
        super(props);

        this.state = {
            description: '',
            completed: false,
            priority: '',
            dateCreated: new Date(),
        }
        this.onSubmit = this.onSubmit.bind(this);
    }

    onChangeDescription(e) {
        this.setState({
            description: e.target.value
        });

    }
    render() {
        return (
            <div>
                <h1>Create a Bug</h1>
            </div>
        )
    }
}
